import React from "react";
import {Link} from "react-router-dom";
import './App.css';


    function login() {

        return (
          <div>

<header className="home-header">

        

<form>
  <h1>Login</h1>
  <input placeholder="Username" type="text" required=""/>
  <input placeholder="Password" type="password" required=""/>
  <Link to="/home"><button>
              Confirm
            </button>
            </Link>
            </form>
            </header>
          </div>

          
        );

    }




    
  export default login;
